import React from "react";
import "./style.css";

function Header() {

    return (
    <div class="jumbotron jumbotron-fluid">
        <div class="container">
        <h1 class="display-4">Catchy Site Name</h1>
        <p class="lead">Tracking Baby's Basic Needs</p>
        </div>
    </div>
    )
}
export default Header;
